import React from "react";
import "./App.css";
import AddressForm from "./components/addressForm";
import AddressAutoComplete from "./components/addressAutoComplete";
import "bootstrap/dist/css/bootstrap.css";

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <div className="App">
        <div className="page-wrapper">
          <div className="container">
            <h1 className="display-3">5 day/3 hour Weather Forecast</h1>
            <p className="lead">
              A practice using OpenWeatherMap and Google Places API
            </p>
            <hr></hr>
          </div>
        </div>
        <AddressAutoComplete />
      </div>
    );
  }
}

export default App;
